import React from "react";
import Hero from "../components/Hero";
import Banner from "../components/Banner";
import { Link } from "react-router-dom";
const Rooms = () => {
  return (
    <Hero hero="roomsHero">
      <Banner title="Our Rooms">
        <LInk to="/" className="btn-primary">
          Return Home{" "}
        </LInk>
      </Banner>
    </Hero>
  );
};

export default Rooms;
